import React from 'react'
import Header from './Header'
import { useState, useEffect } from 'react'
import Axios from 'axios'

function Users() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);

    const [name, setName] = useState('');
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
    const [website, setWebsite] = useState('');

    // address
    const [street, setStreet] = useState('');
    const [suite, setSuite] = useState('');
    const [city, setCity] = useState('');
    const [zipcode, setZipcode] = useState('');
    //address//geo
    const [lat, setLat] = useState('');
    const [lng, setLng] = useState('');

    //company
    const [companyName, setCompanyName] = useState('');
    const [catchPhrase, setCatchPhrase] = useState('');
    const [bs, setBs] = useState('');

    // useEffect(() => {
    //     fetch("http://localhost:3003/users")
    //         .then(res => res.json())
    //         .then(
    //             (result) => {
    //                 setIsLoaded(true);
    //                 setItems(result);
    //             },
    //             (error) => {
    //                 setIsLoaded(true);
    //                 setError(error);
    //             }
    //         )
    // }, [])

    //handler
    const submitHandler = (e) => {
        e.preventDefault()
        Axios.post("http://localhost:3006/addusers", {
            name: name,
            username: username,
            email: email,
            website: website,
            phone: phone,
            street: street,
            suite: suite,
            city: city,
            zipcode: zipcode,
            lat: lat,
            lng: lng,
            companyName: companyName,
            catchPhrase: catchPhrase,
            bs: bs
        }).then((response) => {
            console.log("success");
            console.log(response);
        });
    }

    if (error) {
        return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
        return <div>Loading...</div>;
    } else {
        return (
            <>
                <Header />
                <div style={{ textAlign: 'center' }}>
                    <form onSubmit={submitHandler}>
                        <div className="row">
                            <div className="col-md-4">
                                <label for="Name">Enter Name:</label><br />
                                <input type="text" onChange={(e) => setName(e.target.value)} id="Name" name="Name" /><br />
                                <label for="Username">Enter Username:</label><br />
                                <input type="text" onChange={(e) => setUsername(e.target.value)} id="Username" name="Username" /><br />
                                <label for="Email">Enter Email:</label><br />
                                <input type="email" onChange={(e) => setEmail(e.target.value)} id="Email" name="Email" /><br />
                                <label for="phone">Enter Phone:</label><br />
                                <input type="text" onChange={(e) => setPhone(e.target.value)} id="Phone" name="Phone" /><br />
                                <label for="Website">Enter Website:</label><br />
                                <input type="text" onChange={(e) => setWebsite(e.target.value)} id="Website" name="Website" /><br />
                            </div>

                            <div className="col-md-4">
                                <h5>Enter Address</h5>
                                <label for="street">Enter Street:</label><br />
                                <input type="text" onChange={(e) => setStreet(e.target.value)} id="street" name="street" /><br />
                                <label for="Suite">Enter Suite:</label><br />
                                <input type="text" onChange={(e) => setSuite(e.target.value)} id="Suite" name="Suite" /><br />
                                <label for="City">Enter City:</label><br />
                                <input type="text" onChange={(e) => setCity(e.target.value)} id="City" name="City" /><br />
                                <label for="Zipcode">Enter Zipcode:</label><br />
                                <input type="text" onChange={(e) => setZipcode(e.target.value)} id="Zipcode" name="Zipcode" /><br />

                                <div>
                                    <h5>Enter Geo</h5>
                                    <label for="Lat">Enter Lat:</label><br />
                                    <input type="text" onChange={(e) => setLat(e.target.value)} id="Lat" name="Lat" /><br />
                                    <label for="Lng">Enter Lng:</label><br />
                                    <input type="text" onChange={(e) => setLng(e.target.value)} id="Lng" name="Lng" /><br />
                                </div>
                            </div>
                            <div className="col-md-4">
                                <h5>Enter Company Name</h5>
                                <label for="companyName">Enter companyName:</label><br />
                                <input type="text" onChange={(e) => setCompanyName(e.target.value)} id="companyName" name="companyName" /><br />
                                <label for="catchPhrase">Enter CatchPhrase:</label><br />
                                <input type="text" onChange={(e) => setCatchPhrase(e.target.value)} id="catchPhrase" name="catchPhrase" /><br />
                                <label for="bs">Enter Bs:</label><br />
                                <input type="text" onChange={(e) => setBs(e.target.value)} id="bs" name="bs" /><br />
                            </div>
                        </div>
                        <button type="submit">Submit</button>
                    </form>
                </div>
